import React from 'react'

import { Formik } from 'formik'

const LivingPlaceRegistrationSomeQuestionsFormik = () => {

    return (
        <>
            <Formik
                initialValues={{
                    email: '',
                    password: ''
                }}
                onSubmit={( data ) => console.log(data)}
            >
                {({
                    handleSubmit,
                    handleChange,
                    handleBlur
                }) => {
                    return (
                        <form onSubmit={handleSubmit}>
                            <label htmlFor=''>Email:</label>
                            <input
                                type='text'
                                name='email'
                                onChange={handleChange}
                                onBlur={handleBlur}
                                placeHolder={'email'}
                            ></input>
                        </form>
                    )
                }}
            </Formik>
        </>
    )
}

export default LivingPlaceRegistrationSomeQuestionsFormik
